interface Props {
  pattern: string;
  descrizione: string;
}

function PatternCard({ pattern, descrizione }: Props) {
  return (
    <div className="flex-row relative bg-gray rounded-lg shadow-md">
      <div className="absolute inset-x-0 top-0 rounded-t-xl bg-green-600 text-center font-bold text-lg flex items-center justify-center h-10 truncate">
        <h1 className="flex p-4 text-3xl font-bold mb-4">{pattern}</h1>
      </div>
      <div className="mb-4">
        <h3 className="flex relative pl-4 text-lg font-semibold">
          <p className="flex relative pl-4 pr-4 text-gray-700 leading-relaxed">{descrizione}</p>
        </h3>
      </div>
    </div>
  );
}

export default PatternCard;

